// contracts/KickStarter.sol
// SPDX-License-Identifier: MIT

// Solidity files have to start with this pragma.
// It will be used by the Solidity compiler to validate its version.
pragma solidity ^0.8.7;

contract KickStarter {

    struct Project {
        string name;
        uint fund;
        uint created;
        address owner;
    }

    address public owner;
    Project[] public projects;

    uint public minimumContribution;

    constructor(uint minimum) {
        owner = msg.sender;
        minimumContribution = minimum;
    }


    function getTime() public view returns(bool){
        if ((block.timestamp - projects[0].created) >= 5 seconds) {
            return true;
        } else {
            return false;
        }
    }


    function createProject(string memory name, uint fund) public {
        Project memory newProject = Project({
            name: name,
            fund: fund,
            owner: msg.sender,
            created: block.timestamp
        });

        projects.push(newProject);
    }

    function getProjects() public view returns (Project[] memory) {
        return projects;
    }

    function getProjectAt(uint index) public view returns (Project memory) {
        return projects[index];
    }

    function getProjectsCount() public view returns (uint) {
        return projects.length;
    }


    function contribute(uint projectId) public payable {
        require(msg.value > minimumContribution, 'Contribution amount less than Minimum');

        Project memory project = projects[projectId];

        project.fund +=  msg.value;
    }

    function withdraw() public payable {
        require(msg.value > minimumContribution, 'Contribution amount less than Minimum');
    }
}

